/*

   LETTER SPACING
   Docs: http://tachyons.io/docs/typography/tracking/

   Media Query Extensions:
     -ns = not-small
     -m  = medium
     -l  = large

*/

.tracked       { letter-spacing:  var(--letter-spacing-1); }
.tracked-tight { letter-spacing: var(--letter-spacing-tight); }
.tracked-mega  { letter-spacing:  var(--letter-spacing-2); }

@media (--breakpoint-not-small) {
  .tracked-ns       { letter-spacing:  var(--letter-spacing-1); }
  .tracked-tight-ns { letter-spacing: var(--letter-spacing-tight); }
  .tracked-mega-ns  { letter-spacing:  var(--letter-spacing-2); }
}

@media (--breakpoint-medium) {
  .tracked-m       { letter-spacing:  var(--letter-spacing-1); }
  .tracked-tight-m { letter-spacing: var(--letter-spacing-tight); }
  .tracked-mega-m  { letter-spacing:  var(--letter-spacing-2); }
}

@media (--breakpoint-large) {
  .tracked-l       { letter-spacing:  var(--letter-spacing-1); }
  .tracked-tight-l { letter-spacing: var(--letter-spacing-tight); }
  .tracked-mega-l  { letter-spacing:  var(--letter-spacing-2); }
}
